import React, { Component } from 'react';
import '../App.css';
import axios from 'axios';
import ProjectContainer from './ProjectContainer';

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <p className="lead text-center">
                  Create new project
              </p>
      </div>
    );
  }
}

export default Home;
